import React from 'react';
// import Card from './Card';

const App = () => {
  const numbers = [1, 4, 6, 8, 45, 89];
  const lis = numbers.map((number) => number + 1);
  return (
    <>
      <ul>
        <li>{lis}</li>
      </ul>
    </>
  );
};
export default App;
